'''Ali's Discount Wares''' is a [[shop]] owned by the swindler [[Ali Morrisane]]. It sells similar [[items]] as a [[general store]], as well as desert survival gear. After completion of [[Rogue Trader]], other items can be bought from the store.

It is worth noting that the rune shop prices do not fluctuate. Many [[Ironman Mode|Ironmen]] will find themselves with an excessive amount of [[Blood rune|blood]] and [[soul rune]]s which sell for {{Coins|200}} and {{Coins|150}} respectively (50% of the item value).

